import './App.css';
import PruebaComponent from './screens/pruebaComponent';

import { BrowserRouter as Router, Route} from 'react-router-dom';

function App() {
  return (
    <Router className="App">
      <Route path="/">
        <PruebaComponent/>
      </Route>
    </Router>
  );
}

export default App;
